import React from 'react';
import { Routes, Route } from 'react-router-dom';
// import LoginContextProvider from './context/LoginContext';
import Login from './Pages/Login';
import ListaDeAcoes from './Pages/ListaDeAcoes';
import ComprarOuVender from './Pages/ComprarOuVender';
import DepositoOuRetirada from './Pages/DepositoOuRetirada';
import NotFound from './Pages/NotFound';
import './App.css';

function App() {
  return (
    // <LoginContextProvider>
    <Routes>
      <Route exact path="/" element={<Login />} />
      <Route path="/listaDeAcoes" element={<ListaDeAcoes />} />
      <Route path="/comprarOuVender" element={<ComprarOuVender />} />
      <Route path="/depositoOuRetirada" element={<DepositoOuRetirada />} />
      <Route path="*" element={<NotFound />} />
    </Routes>
    // </LoginContextProvider>
  );
}

export default App;
